import React from "react";
import {
    BrowserRouter,
    Routes,
    Route,
    Link
} from "react-router-dom";
import {NavBar} from './components/NavBar'
import { Login } from "./pages/login";

export function App() {
    return (
        <BrowserRouter>
            <Routes>
                <Route path="/" element={<Login/>}></Route>
                <Route path="/home" element={<NavBar/>}></Route>
            </Routes>
        </BrowserRouter>
    );
}
